import React from 'react';
// import { Link } from '@reach/router';


const People = (props) => {
    return (
        <>
            <h1>Welcome</h1>
            <div class="form-floating">
                <select class="form-select" id="floatingSelectGrid" aria-label="Floating label select example">
                    <option selected>Open this select menu</option>
                    <option value="1">{props.People}</option>
                    <option value="2">{props.Planets}</option>
                </select>
                <label for="floatingSelectGrid">Search For</label>
            </div>

            <div className="form-floating">
                <input type="ID" class="form-control" id="floatingInputGrid" placeholder="ID" value="ID"/>
                <label for="floatingInputGrid">Id</label>
            </div>
            <button type="button" class="btn btn-danger">Search</button>
        </>
    );
}
export default People;
